import { createTheme } from '@mui/material/styles';


const theme=createTheme({
    palette:{
        primary:{
            main:'#fff'
         },
         secondary:{
             main:'#000'
         },
         background:{
             default:'radial-gradient(circle at 3% 25%, rgba(0, 40, 83, 1) 0%, rgba(4, 12, 24, 1) 100%)'
         }
        
    }
  })


export default theme
